/* eslint-disable no-empty-function, no-restricted-syntax */
'use strict';

var isNativeFunction = require( './../lib' );

console.log( isNativeFunction( Math.sqrt ) );
// => true

console.log( isNativeFunction( Date ) );
// => true

console.log( isNativeFunction( RegExp ) );
// => true

console.log( isNativeFunction( function foo() {} ) );
// => false

console.log( isNativeFunction( 'beep' ) );
// => false

console.log( isNativeFunction( 5 ) );
// => false

console.log( isNativeFunction( true ) );
// => false

console.log( isNativeFunction( null ) );
// => false

console.log( isNativeFunction( [] ) );
// => false

console.log( isNativeFunction( {} ) );
// => false
